import React from 'react';

const InvestPage = () => {
  return (
    <div className="invest-page">
      <h2>투자내역</h2>
      <div className="invest-content">
        <p>아직 투자 내역이 없습니다.</p>
      </div>
    </div>
  );
};

export default InvestPage;
